Mixed media on paper.
These images are some of the components of a large painting I made a while ago, it is comprised of postcard sized experiments with accompanying index cards displaying related text. For each experiment I used white and black acrylic paint mixed with various combinations and layers of found materials chosen for their performative qualities and their everyday use. I mixed them and layered them, observing their interactions with one another and with the ambient light, transforming their material identities as the tactile textured surfaces engage the perception of touch as though to view it is to act within the painting. The index cards recorded the materials used as well as the chains of associations conjoured in my mind by each material combination and the surfaces and shapes they made. This piece was lots of fun to make. 

Materials
1. White acrylic paint, lemon tea, tea stained latex
2. Cumin seeds, white acrylic paint, gloss varnish, black acrylic paint 
3. Cacao and white acrylic paint, wax, black acrylic paint
4. Squash seeds, white acrylic paint, black acrylic paint, gloss varnish, black gloss varnish
5. Bicarbonate of soda, white acrylic paint, wax, black oil paint
6. Seed beads, white acrylic paint, gloss varnish mixed with black acrylic paint, wax
7. Loose leaf tea, white acrylic paint, gloss varnish, black acrylic paint, latex, white wax, black wax.
8. Paper pulp and black acrylic paint, diluted white acrylic paint, PVA glue
9. White acrylic paint, hay, PVA glue
10. White acrylic paint, sage, wax, black acrylic paint 

